import React, { Component } from 'react';
import './Main.css'

class WeekMonthMain extends Component {

  render() {
    return (
      <div>
        // <div> BudgeIt </div>
        // <button> Sign Up </button>
        // <button> Log In </button>
        <img src="https://budget.buffalostate.edu/sites/budget.buffalostate.edu/files/styles/large_image/public/image/Budget%201.jpg?itok=CFdiQ1KD" id="image"></img>
      </div>
    );
  }
}

export default WeekMonthMain;
